pub enum OriginProtocol {

    /// Http protocol
    Http,

    /// Https protocol
    Https,

    /// Custom protocol
    Custom(String),
}

pub enum AccessControlAllowOrigin {

    /// Specific hostname
    Value(Origin),

    /// null-origin (file:///, sandboxed iframe)
    Null,

    /// Any non-null origin
    Any,
}

pub enum AccessControlAllowHeaders {

    /// Specific headers
    Only(Vec<String>),

    /// Any header
    Any,
}

pub enum AllowCors<T> {

    /// CORS header was not required. Origin is not present in the request.
    NotRequired,

    /// CORS header is not returned, Origin is not allowed to access the resource.
    Invalid,

    /// CORS header to include in the response. Origin is allowed to access the resource.
    Ok(T),
}

pub enum Port {

    /// No port specified (default port)
    None,

    /// Port specified as a wildcard pattern
    Pattern(String),

    /// Fixed numeric port
    Fixed(u16),
}

pub enum DomainsValidation<T> {

    /// Allow only domains on the list.
    AllowOnly(Vec<T>),

    /// Disable domains validation completely.
    Disabled,
}

pub enum UninitializedExecutor {

    /// Shared instance of executor.
    Shared(TaskExecutor),

    /// Event Loop should be spawned by the transport.
    Unspawned,
}

pub enum Executor {

    /// Shared instance
    Shared(TaskExecutor),

    /// Spawned Event Loop
    Spawned(RpcEventLoop),
}

pub enum Separator {

    /// No envelope is expected between messages. Decoder will try to figure out
    /// message boundaries by accumulating incoming bytes until valid JSON is formed.
    /// Encoder will send messages without any boundaries between requests.
    Empty,

    /// Byte is used as an sentitel between messages
    Byte(u8),
}
